$_MODULE['<{supercheckout}prestashop>supercheckout_f702ec5deb9b0e80db05af6912900fea'] = "La raison de ces erreurs n'est pas spécifique. Si vous faites face à l'un de ces problèmes, veuillez nous contacter avec vos détails d'administrateur et de FTP.";
