$_MODULE['<{supercheckout}prestashop>supercheckout_08ca6a947fc70d8babef7f7ec6aeb024'] = "Veuillez réessayer après avoir effacé votre cache Prestashop en utilisant le paramètre Advance-> Performance-> Effacer le bouton de cache. Si votre problème persiste même après cela, assurez-vous que votre répertoire de thème ne contient pas notre fichier de traduction de module. Pour vérifier ceci, accédez à votre répertoire de thème";
