$_MODULE['<{supercheckout}prestashop>supercheckout_a6f90da86996e1221fda518644259beb'] = "Lorsque vous traduisez le texte de notre panneau d'administration de module, notre module enregistre le texte traduit dans";
$_MODULE['<{supercheckout}prestashop>supercheckout_d7529a65fb108570a2aed2400414c23d'] = "Mais lorsqu'il existe une traduction dans votre répertoire de thème, notre module choisit du texte à partir de là et votre texte traduit ne se reflète pas à l'avant.";
$_MODULE['<{supercheckout}prestashop>supercheckout_bf4ad7ba59bbead463e5e2139692e642'] = "Maintenant, la question se pose, auquel cas le répertoire de thème peut avoir notre fichier texte traduit par module.";
$_MODULE['<{supercheckout}prestashop>supercheckout_0787d403d8b13efef7fe01c7abe369d7'] = "Lorsque vous utilisez la fonction de traduction par défaut de Prestashop, il enregistre le texte traduit dans le répertoire de thème et notre module utilise du texte à partir de ce répertoire de thèmes plutôt que d'utiliser du texte à partir du répertoire du module.";
